Занятия проводятся небольшими группами по 3-4 человека. Дети обучаются навыкам верховой езды в леваде, затем закрепляют полученные навыки на живописных маршрутах по лесам и полям в сопровождении инструкторов.
                                 <br>
                                 - Техника безопасности (проводится сразу по прибытию в лагерь и вторично обговаривается каждый день);
                                 <br>
                                 - Уход за лошадьми (уход за лошадьми, уборка конюшни);
                                 <br>
                                 - Основы управления лошадью на шагу;
                                 <br>
                                 - Правильная посадка и спешивание с лошади;
                                 <br>
                                 - Подготовка лошади к верховой езде (седловка, чистка; теория, практика);
                                 <br>
                                 - Учебные упражнения на шагу включают в себя иппотерапию;
                                 <br>
                                 - Подготовка всадника к езде и езда рысью (облегченной, учебной);
                                 <br>
                                 - Индивидуальные занятия в леваде, а также прогулки в лес в поводу для неопытных наездников;
                                 <br>
                                 - Практика: рысь и галоп (левада, лес, поле);
                                 <br>
                                 - Конные эстафеты.

Два или три дня (на ваше усмотрение), в которые ребята будут: проходить развлекательную, насыщенную программу, которую мы разработает специально для вас

<br>

Для нас важно, чтобы в эти дни ребята не просто ностальгировали по школьному времени, а, как минимум, могли:

<br>
- весело и необычно провести несколько дней вместе, которые они точно запомнят;
- открыться с новой стороны друг для друга;
<br>
- вспомнить и посмеяться вместе над школьными годами;
<br>
- дать возможность отдохнуть учителям и родителям.
